import Navbar from "./Navbar";
import { useContext } from "react";
import { CoursesContext } from "../Helpers/Context";
const Main = () => {
    const {context} = useContext(CoursesContext);

    return (
        <>
            <Navbar />
            <button onClick={() => showAllCourses()} />
        </>
    );
};

export default Main;
